import { Component } from "react";
import { Router, Route, Switch } from "react-router";
import Login from './pages/login'
import Home from './'

class App extends Component
{
    render()
    {
        return(
            <>
            <Router>
                <Route path='/' Component={Login}/>
            </Router>
            </>
        )
    }
}

export default App
